import logo from './logo.svg';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import { Fragment, Suspense } from 'react';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Fragment>
      <Suspense fallback={<></>}>
        <Routes>
          <Route element>

          </Route>
        </Routes>
      </Suspense>
    </Fragment>
  );
}

export default App;
